import Paper from '@mui/material/Paper';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';

export const ListOfSelectedProducts = () => {
    const flexContainer = {
        display: 'flex',
        flexDirection: 'row',
        padding: 0,
      };

      return (
        <Paper elevation={3} style={{width: '30%', borderRadius: '7px', padding: '10px'}}>
            <List sx={flexContainer}>
                <ListItem
                    primaryText="foo1"
                    secondaryText="bar1"/>
                <ListItem
                    primaryText="foo2"
                    secondaryText="bar2"/>
            </List>
        </Paper>
      );
}
